114.body:
Creating a custom event normally happens in JavaScript, because it's part of the browser's runtime. The code looks like this: const event = new Event('build'); // Listen for the event.
elem.addEventListener('build', (e) => { /* … */ }, false); // Dispatch the event.
elem.dispatchEvent(event); https://developer.mozilla.org/en-US/docs/Web/Events/Creating_and_triggering_events We need to do something similar in our Rust code. To do this we'll use the web_sys crate. There is a struct in web_sys called CustomEvent Docs Let's go over some struct basics since we're going to e using them for this lesson and going forward. Introduction to Structs A struct is like a class in a lot of object oriented languages. It is a category of type that has the ability to group data, functionality related to that data, and functionality related to its general idea, all around a single name. Recall that a type is the name that describes a set of possible values. Struct data One of the key features of structs in Rust is that they specify a grouping of data types and values which we call properties. I suspect this is why they're called structs—structured data or data structure. If we had a Bacon Lettuce and Tomato sandwich struct it's definition would look like this: struct BLTSandwich { bread: TypeOfBread, lettuce: TypeOfLettuce, tomato: TypeOfTomato, bacon: TypeOfBacon, mayo: bool
} The above example expects that TypeOfBread, TypeOfLettuce, TypeOfTomato, and TypeOfBacon are all defined earlier. They are used here to illustrate that BLTSandwich has constrained which values it's specific proeprties can have. You can not have a BLTSandwich with rocks as a value for bacon, because rocks are not a type of bacon! This is why type systems are important. They help prevent us from eating rocks... or... making mistakes in our programs. :) If you have keen eyes you'll recognize something here. There's a pattern that we've seen a few times before. // a function definition
fn function_name( parameter: type ) {} // a struct definition
struct StructName{ property: type } This pattern can be abstracted to the following: Rust keyword to define context/subject (fn, struct) A name to be able to use the noun(function_name, StructName) Some form of encapsulation with configuration Make a new thing from an idea (a concretion) A struct or structure is like an idea. And ideas aren't real in a sense that we can't hold them. We have an idea of what a BLT Sandwich is, but we can't eat the idea. But we have written specification for what the BLT is in the definition of our struct. If we were to take the idea of a BLT sandwich and make A BLT sandwich we would say that we were making a concretion. A thing that is concrete or real. In object oriented programming (OOP) we would say that we are instantiating the idea (in oop ideas are classes). We are creating an instance of it. The syntax to create a struct includes writing the stuct's name, followed by curly braces, and a list of the property names and their values. // Assuming that the values for these // properties were already defined in scope
// with statements like
// let canadian_rye = get_the_best_sandwich_bread();
BLTSandwich{ bread: canadian_rye, lettuce: romaine, tomato: black_krim, bacon: farm_smoked_apple_bacon,
} Most library (crate) authors write functions associated with a struct (with the idea of it) to make a concretion. It's convention for this function to be called 'new'. Calling the function follows this syntax: let my_thing = SomeStruct::new(); Functionality associated with the idea (static methods) Structs can have functionality associated with the name of the struct. Some would described as functions that are namespaced, meaning that they are prefixed to or expected to be understood in the context of the name (being the struct's name). The following showcases a new function in the BLTSandwich namespace which returns a new BLTSandwich (a concretion). impl BLTSandwich { pub fn new() -> BLTSandwich { BLTSandwich{ bread: canadian_rye, lettuce: romaine, tomato: black_krim, bacon: farm_smoked_apple_bacon } } pub fn name() -> String { "Bacon, Lettuce and Tomato Sandwich".to_string() }
} Normally there would be parameters in the new function to accept arguments to configure the new thing being created. I skipped on that for the sake of simplicity. We can see here that we also have a name function which returns a long form name of the sandwich as a string. We could call this by writing: let the_sandwich_name : String = BLTSandwich::name(); Again, we can see that these are functions associated with the idea and separated by two colons. But again, look closely! A pattern emerges! We previously used a function called leptos::log!. But leptos isn't a struct, it's a crate! Rust uses the same pattern of double colons to say, "We're setting the context to qualify which thing we're talking about". When we say BLTSandwich::name, we're telling Rust "Ok, think about BLTSandwich things... when I say name, you know what I'm talking about." The Rust language designers have done a superb job at making these things easy to remember if you're aware that there is a pattern and design behind the decision. I can only assume that these design decisions were very deliberate. Functionality associated with the a concretion (methods) We can associate functionality with a specific concretion (a struct made real) which we often call methods. If we had a mthod called calories we could call with the following Rust code: let sandwich = BLTSandwich::new();
let calories = sandwich.calories(); Here we make a sandwich and call calories on it. The context here is so tightly coupled that we use a single dot as a separator. I like to think of it as this. 4 dots — A namespace is a grouping of many things, so we use many dots. 1 dot — A value is a single thing, so we use one dot. The neat thing about the above is that if you didn't need to use sandwich you can chain these all together: let calories = BLTSandwich::new().total_calories(); ^----------------^ This will evaluate into a 'sandwich' which we can call total_calories() on. Methods always have a special &self parameter as the first argument to denote that they're able to make reference to itself. This is how a function has the ability to do anything with it's own data. Recall that we can not use a piece of data unless it is in scope. // Imagine that there is some function called calories, // which accepts things that can be turned into a calories
// value which is a 32 bit integer. Don't worry about how this
// would work. This is just a simple example. impl BLTSandwich { // imagine the other static methods or namespace // function from before were still here. pub fn total_calories(&self) -> i32 { calories(self.bread) + calories(self.lettuce) + calories(self.tomato) + calories(self.bacon) // Recall that this function will evaluate to the // last statement in its body. That's why there's no // semicolon at the end of this last item. } pub fn name() -> String { "Bacon, Lettuce and Tomato Sandwich".to_string() }
} Note that we're able to use the value of the struct's properties with .bread. If we look at the function total_calories it starts to look really similar to .bread. with the exception of us adding parenthesis at the end to call the fucntion. Yet another pattern emerges, methods on a value are properties on the value that you can call! let sandwich = BLTSandwich::new();
sandwich.bread;
sandwich.total_calories; //<- but then we add () to call it Using web_sys::CustomEvent We're well positioned to use the web_sys crate's CustomEvent struct. If we zip over to the documentation we can see that there is a new method on the struct Docs : web_sys::CustomEvent::new("my-custom-event"); But there's a notice under the definition of the new method that states the following: This API requires the following crate features to be activated: CustomEvent I did a quick search for "web_sys enable feature" which lead me to this support doc Enable the cargo features for the APIs you're using . Leptos includes these web_sys features for you as part of its library. If we go back to the new method's definition in the web_sys::CustomEvent docs we'll see the following definition: pub fn new(type_: &str) -> Result<CustomEvent, JsValue> Notice that it returns after the -> a Result type, which has some type arguments (generics). The first one refers to what we get if new is run and the result is Ok, the second is the result that we get if new runs and the result is an Error. We can handle these with some in build pattern matching which we'll go into more later. Our component code now looks like this: #[component] fn MyComponent(cx: Scope) -> Element { let trigger_sending_of_custom_event = |_|{ match web_sys::CustomEvent::new("my-custom-event") { Ok(event) => { // We have an event that we can send }, Err(_) => { // There as an error in creating the event // We're not doing anything with this for now // so we'll use an '_' to destructure it's error // message } } }; view!{ cx, <div> <button on:click=trigger_sending_of_custom_event> "Trigger custom event" </button> </div> } } The match keyword requires that we create branches/arms for each possible option. Recall that we talked about types as restrictions that describe possible values. A result is an enumeration (a list of possible values or strict set of options) which can be one of two values. It can be Ok or Err. The options are called variants. In both of those cases there is a value that we can destructure out of the variants. Their types are listed as the the first and second type arguments in the returned type's signature. Result<CustomEvent, JsValue> means that we'll have an Ok( CustomEvent ) or an Err(JsValue). I know from the JavaScript custom event documentation that it's not enough to create the event. We need to emit it. This is called dispatching. The javascript looks like this. elem.dispatchEvent(event); What we need is some way to refer to our <MyComponent /> so that we can dispatch the event on it. We need a reference to it.

115.body:
Leptos provides us with the ability to get a reference to the DOM node created by its view! template. Think of it like a direct line to its DOM counterpoint. The first step is to create the nodeRef, and add it as a special _ref property to the parent/root element in the view! template. Recall that the Leptos component is proxy for the view! template's root element. Putting the reference on this div is the same as putting the reference on <MyComponent />. #[component] fn MyComponent(cx: Scope) -> Element { let dom_node_ref = NodeRef::new(cx); // abbreviated/folded Rust code here for space saving view!{ cx, <div _ref=dom_node_ref> <button on:click=trigger_sending_of_custom_event> "Trigger custom event" </button> </div> }
} The dom_node_ref uses signals under the hood so we can move it into our handler closure without stressing about move semantics. We'll add the move keyword to the closure and we'll add some more matching if we are able to make our custom event. match dom_node_ref.get() { None => { // None will only happen if this component isn't // mounted to the DOM, but it has to be in order // for the click event to fire, so we can ignore this } Some(dom_element) => { // Emit/dispatch our custom event } } We call 'get' on the dom_node_ref to get the actual DOM element in Rust form. There are cases when the DOM element/node might not exist. Rust requires us to account for all possibilities, which is why the get method returns a option type. It's return type definition is Option<web_sys::Element>. Option is an enum which can be None or Some with the type argument provided in it's signature. In this case it's of the web_sys::Element type. We're destructing it and giving it the label dom_element #[component] fn MyComponent(cx: Scope) -> Element { let dom_node_ref = NodeRef::new(cx); let trigger_sending_of_custom_event = move |_|{ match web_sys::CustomEvent::new("my-custom-event") { Ok(event) => { match dom_node_ref.get() { None => { // None will only happen if this component isn't // mounted to the DOM, but it has to be in order // for the click event to fire, so we can ignore this } Some(dom_element) => { // Emit/dispatch our custom event } } }, Err(_) => {} } }; view!{ cx, <div _ref=dom_node_ref> <button on:click=trigger_sending_of_custom_event> "Trigger custom event" </button> </div> } } Intuitively, we'll probably want to try something like this for the actual event sending. This is a focused view of the happy path match arm: match dom_node_ref.get() { None => {} Some(dom_element) => { dom_element.dispatch_event(event); } } Unfortuantely this doesn't work. Rust tells us that dispatch_event is expecting a &event, a reference to an event. Let's add an ampersand before event to send a reference. Rust's compiler may complain about unhandled results from the event dispatch. We can add another match statement to handle those. match dom_element.dispatch_event(&event) { Ok(_) => { leptos::log!("Custom event sent") }, Err(_) => { leptos::log!("Failed to send") } } We can now listen to our custom event from our Leptos component: #[component] fn RadApp(cx: Scope) -> Element { let log_response = |_| { leptos::log!("Our custom event happened") }; view! { cx, <MyComponent on:myCustomEvent=log_response/> } } Note that event names are camelCased We're still not totally there yet though. We need to actually tell this new custom event to bubble. //We need to create a config that is mutable (so we add 'mut' after let)
let mut event_config = web_sys::CustomEventInit::new(); // We set the bubble property to true
event_config.bubbles(true); // We create a new event with the special config using a different constructor method let event = web_sys::CustomEvent::new_with_event_init_dict( "myCustomEvent", &event_config
); // was previous
// let event = web_sys::CustomEvent::new("myCustomEvent"); And just like that we have custom events on components with references! The Complete Code use leptos::*; fn main() { mount_to_body(|cx| { view! { cx, <RadApp /> } }) } #[component] fn RadApp(cx: Scope) -> Element { let log_response = |_| { leptos::log!("Our custom event happened") }; view! { cx, <MyComponent on:myCustomEvent=log_response /> } } #[component] fn MyComponent(cx: Scope) -> Element { let dom_node_ref = NodeRef::new(cx); let trigger_sending_of_custom_event = move |_| { let mut event_config = web_sys::CustomEventInit::new(); event_config.bubbles(true); let event = web_sys::CustomEvent::new_with_event_init_dict("myCustomEvent", &event_config); match event { Ok(event) => { match dom_node_ref.get() { None => {} Some(dom_element) => { match dom_element.dispatch_event(&event) { Ok(_) => { leptos::log!("Custom event sent") }, Err(_) => { leptos::log!("Failed to send") } } } } } Err(_) => {} } }; view! { cx, <div _ref=dom_node_ref> <button on:click=trigger_sending_of_custom_event> "Trigger custom event" </button> </div> } }

123.body:
For the most simple example we can actually hard code the configuration into the event sender. We don't need to pull it out any HTML data attributes or input fields. Our template could look like this: view! { cx, <div _ref=dom_node_ref> <h3>"BLT Sandwich"</h3> <button on:click=trigger_order_sandwich_event > "Order Sandwich" </button> </div> } We need to update the event handler so that our new custom event is sent with this extra data. Web events have a property on their JavaScript object called detail, which we can use to story and carry arbitrary data. After we initialize the event_config, we modify it so that it bubbles up (so that ancestors can respond to the event), and then we'll do another modification to add the detail data. Recall that if we're changing a piece of data we need to write mut before the name of it to specify that it can be changed, that it can be MUTated. let mut event_config = web_sys::CustomEventInit::new(); event_config.bubbles(true); event_config.detail(&data); But now you're probably wondering, what is &data. We're providing the detail method on event_config with a reference (denoted with the & ) to data. The detail method accepts any JsValue. In our simple example, we're only going to specify bread type. let bread_type = JsValue::from("Canadian Rye"); event_config.detail( &bread_type ); We are calling the from static method on the JsValue struct to create a new JsValue from our string slice "Canadian Rye". We're then using the bread_type as an argument for the detail method, but we're passing the data as a reference, denoted with the &; If you forget the ampersand the Rust compiler will actually make the recommendation for you to include it so that your usage matches the detail() method's definition. To use JsValue we need to bring it into scope. At the top of your main.rs file, add use crate::wasm_bindgen::JsValue; Our whole BLT component looks like this: #[component] fn BltSandwich(cx: Scope) -> Element { let dom_node_ref = NodeRef::new(cx); let trigger_order_sandwich_event = move |event| { let mut event_config = web_sys::CustomEventInit::new(); event_config.bubbles(true); let bread_type = JsValue::from("Canadian Rye"); event_config.detail( &bread_type ); let event = web_sys::CustomEvent::new_with_event_init_dict( "orderSandwich", &event_config ); match event { Ok(event) => { match dom_node_ref.get() { None => {} Some(dom_element) => { match dom_element.dispatch_event(&event) { Ok(_) => { leptos::log!("Custom event sent") }, Err(_) => { leptos::log!("Failed to send") } } } } } Err(_) => {} } }; view! { cx, <div _ref=dom_node_ref> <h3>"BLT Sandwich"</h3> <button on:click=trigger_order_sandwich_event> "Order Sandwich" </button> </div> } } Now let's look at the top part of our app with our mount_to_body and top level app component: fn main() { mount_to_body(|cx| { view! { cx, <SandwichShopApp /> } }) } #[component] fn SandwichShopApp(cx: Scope) -> Element { let log_order = |_| { leptos::log!("Our custom event happened"); }; view! { cx, <BltSandwich on:orderSandwich=log_order /> } } Let's focus in on the orderSandwich event handler: let log_order = |_| { leptos::log!("Our custom event happened"); }; Note that before we had a underscore for the event parameter of the handler. We had no need of the event in the context of our closure's body (in-between the curley braces) so we wrote an underscore to tell Rust that we're not using. This is a Rust convention. Now we need the event but we don't know what type it is. We can let Rust do the work for us. Put any type in there and run trunk serve if you're not already. let log_order = |event: i32| { leptos::log!("Our custom event happened"); }; The compiler will check for you and tell you about the mismatch. expected closure signature `fn(Event) -> _` found closure signature `fn(i32) -> _` This tells us that it should be an Event type, not i32. :D The compiler is so helpful. let log_order = |event: Event| { leptos::log!("Our custom event happened"); }; If we just write the above the compiler will also tell us that "Event" doesn't exist in our scope. It's telling us we need to be more specific about what we mean. Then it outlines ways that we can bring the definition of events into our scope. help: consider importing one of these items |
1 | use crate::web_sys::Event; |
1 | use web_sys::Event; | Use web_sys::Event would force all Event types to be web_sys::Event types. Think of it like we're importing the type. We can also just manually write the type with the namespace in our closure. I prefer to include the crate or module as context for clarity. let log_order = |event : web_sys::Event| { ...feels more clear than... let log_order = |event : Event| { Shorter code isn't always better code. Aim to be clear and to avoid ambiguity. Now, unfortunately there is no detail() method on a web_sys::Event. But a web_sys::Event is a JsValue and we can turn it into a custom event: let custom_event = event.unchecked_into::<web_sys::CustomEvent>(); Here we're calling the unchecked_into method on the event and using the turbo fish ::<> syntax to provide the destination type argument, which is a web_sys::CustomEvent. It should be noted that this is a unique behaviour to working with things that are JsValue types at their core. Rust doesn't normally work this way and you can not just smash one type into another type with this ease. JavaScript is not a typed language. When we work with JsValues we're often taking the raw data from JavaScript and pushing it into a Rust context where we enforce type safety from there forward. This is how we can call unchecked_into to convert the regular event to the custom event, granting us access to the .detail() method. Our app event handler now looks like this: let log_order = |event : web_sys::Event| { let custom_event = event.unchecked_into::<web_sys::CustomEvent>(); let sandwich_type = custom_event.detail(); leptos::log!("Our custom event happened"); leptos::log!("{:?}", sandwich_type ); }; You'll note that when we log the value of sandwich_type, the console in your browser will say JsValue("Canadian Rye"). The value we pulled out of detail() is a JsValue and needs to be converted into a rust type to be used elsewhere in your system. We can use a special method on JsValue values called as_string(), but it returns an Option type which we can handle with our match statements. let log_order = |event : web_sys::Event| { leptos::log!("Our custom event happened"); let custom_event = event.unchecked_into::<web_sys::CustomEvent>(); let bread_type_js = custom_event.detail(); let opt_bread_type_rs = bread_type_js.as_string(); match opt_bread_type_rs { Some(bread_type) => { leptos::log!("{:?}", bread_type ) }, None => {} } }; We can reduce assignments here by chaining all of these together. let log_order = |event : web_sys::Event| { leptos::log!("Our custom event happened"); let bread_type = event .unchecked_into::<web_sys::CustomEvent>() .detail() .as_string() .unwrap_or(String::new()); leptos::log!("{:?}", bread_type ); }; The new method here is unwrap_or, which takes the Some value or uses a default value (provided as an argument) if none. The whole thing together looks like this: use leptos::*; use crate::wasm_bindgen::JsValue; fn main() { mount_to_body(|cx| { view! { cx, <SandwichShopApp /> } }) } #[component] fn SandwichShopApp(cx: Scope) -> Element { let log_order = |event : web_sys::Event| { leptos::log!("Our custom event happened"); let bread_type = event .unchecked_into::<web_sys::CustomEvent>() .detail() .as_string() .unwrap_or(String::new()); leptos::log!("{:?}", bread_type ); }; view! { cx, <BltSandwich on:orderSandwich=log_order /> } } #[component] fn BltSandwich(cx: Scope) -> Element { let dom_node_ref = NodeRef::new(cx); let trigger_order_sandwich_event = move |event| { let mut event_config = web_sys::CustomEventInit::new(); event_config.bubbles(true); let bread_type = JsValue::from("Canadian Rye"); event_config.detail( &bread_type ); let event = web_sys::CustomEvent::new_with_event_init_dict( "orderSandwich", &event_config ); match event { Ok(event) => { match dom_node_ref.get() { None => {} Some(dom_element) => { match dom_element.dispatch_event(&event) { Ok(_) => { leptos::log!("Custom event sent") }, Err(_) => { leptos::log!("Failed to send") } } } } } Err(_) => {} } }; view! { cx, <div _ref=dom_node_ref> <h3>"BLT Sandwich"</h3> <button on:click=trigger_order_sandwich_event> "Order Sandwich" </button> </div> } }

128.body:
Rust has the ability to create modules to encapsulate code. It allows you to expose parts of the code to the outside world, while keeping other parts of the code private to the module. A module is defined by using the key word mod followed by the name of the module and curley braces which encapsulate the code in a module. mod my_module { pub fn hello_world() { println!("Hi"); } fn you_cant_call_me() { println!("Seeecrets"); }
} We've seen this pattern of set the context then noun the content/definition all over the place. These patterns repeat all over the place. The module can be used in the scope in which it is defined without any extra work. We must prefix functions with 'pub' in a module to specify that they are public. Functions in a module have access to private functions that are within the module because they're all in the same module scope. Calling a function inside a module requires you to specify the module's namespace followed by two colons and the function name. mod my_module { pub fn hello_world() { println!("Hi"); } fn you_cant_call_me() { println!("Seeecrets"); }
} fn main() { // ✅ We can call this public function my_module::hello_world(); // ❌ We can't call this private function my_module::you_cant_call_me();
} Module files Modules can be moved to their own files as well. Create a my_module.rs file in the ./src folder fo your application pub fn hello_world() { println!("Hi");
}
fn you_cant_call_me() { println!("Seeecrets");
} Bring it into scope in your ./src/main.rs file with mod my_module which will automatically hook up the file my_module.rs mod my_module; fn main() { my_module::hello_world();
} Now, while you can do this, it's not ideal.

130.body:
We started off with the following from a previous lesson: use leptos::*; use crate::wasm_bindgen::JsValue; fn main() { mount_to_body(|cx| { view! { cx, <SandwichShopApp /> } }) } #[component] fn SandwichShopApp(cx: Scope) -> Element { let log_order = |event : web_sys::Event| { leptos::log!("Our custom event happened"); let bread_type = event .unchecked_into::<web_sys::CustomEvent>() .detail() .as_string() .unwrap_or(String::new()); leptos::log!("{:?}", bread_type ); }; view! { cx, <BltSandwich on:orderSandwich=log_order /> } } #[component] fn BltSandwich(cx: Scope) -> Element { let dom_node_ref = NodeRef::new(cx); let trigger_order_sandwich_event = move |event| { let mut event_config = web_sys::CustomEventInit::new(); event_config.bubbles(true); let bread_type = JsValue::from("Canadian Rye"); event_config.detail( &bread_type ); let event = web_sys::CustomEvent::new_with_event_init_dict( "orderSandwich", &event_config ); match event { Ok(event) => { match dom_node_ref.get() { None => {} Some(dom_element) => { match dom_element.dispatch_event(&event) { Ok(_) => { leptos::log!("Custom event sent") }, Err(_) => { leptos::log!("Failed to send") } } } } } Err(_) => {} } }; view! { cx, <div _ref=dom_node_ref> <h3>"BLT Sandwich"</h3> <button on:click=trigger_order_sandwich_event> "Order Sandwich" </button> </div> } } We'll start by making a module. mod component_custom_event { } For the time being we'll remove the complexity of dealing with the event data, omitting the following lines: let bread_type = JsValue::from("Canadian Rye"); event_config.detail( &bread_type ); How it's time to start moving things into the module and generalizing them or making them configurable. I could see myself annotating the following code with a comment like //first create a custom event. let mut event_config = web_sys::CustomEventInit::new(); event_config.bubbles(true); let event = web_sys::CustomEvent::new_with_event_init_dict( "orderSandwich", &event_config ); This immediately tells me that there's a name I can give to these lines that summarizes them. We're creating a new custom event. We do need to give this new event a name, which instantly makes me think, "Name is a parameter!" We also know that new_with_event_init_dict() returns a Result type, which we handled before with our match statement. Let's start by stubbing out the definition: mod component_custom_event { fn new(name: &str) -> Result<web_sys::CustomEvent, JsValue> { // do stuff } If this worked we could use component_custom_event::new("orderSandwich") and we should get what we expect to continue in our event handler. A module is a separate scope. It acts in a similar way to main.rs, which has it's own scope. Rust is very good at being congruent like that. web_sys and JsValue aren't defined in the module. To fix this we'll add some use statements. use leptos::*; //web_sys is imported as part of leptos's prelude
use leptos::wasm_bindgen::JsValue; Let's copy the code block in as the body: mod component_custom_event { use leptos::*; use leptos::wasm_bindgen::JsValue; fn new(name: &str) -> Result<web_sys::CustomEvent, JsValue> { let mut event_config = web_sys::CustomEventInit::new(); event_config.bubbles(true); let event = web_sys::CustomEvent::new_with_event_init_dict( "orderSandwich", &event_config ); }
} And, we need to hook up our property so that it's arguments are used in the events configuration. To do this we need to replace the literal "orderSandwich" with name. Now the value of the name function parameter will be used as the event's name, passed as the first argument to new_with_event_init_dict(). mod component_custom_event { fn new(name: &str) -> Result<web_sys::CustomEvent, JsValue> { let mut event_config = web_sys::CustomEventInit::new(); event_config.bubbles(true); let event = web_sys::CustomEvent::new_with_event_init_dict( name, &event_config ); }
} But we're not quite done here. We have an assignment for the last expression with let event =. And the last expression has a semicolon ; at the end. This would result in the new function returning a unit type, written as (). If we want to return the event we could write event at the end, without a semicolon, so that it would be the "last word" in the function. Recall that Rust is expression based and the last open expression is used as the return of functions and scope blocks (unless you write return and provide it something to explicitly return). Let's remove the assignment and semicolon, and we're done with this one. mod component_custom_event { fn new(name: &str) -> Result<web_sys::CustomEvent, JsValue> { // configuration let mut event_config = web_sys::CustomEventInit::new(); event_config.bubbles(true); // generation web_sys::CustomEvent::new_with_event_init_dict( name, &event_config ) }
