} or match data.get("fav_thing_to_paint").as_string() { Some(fav_thing) => {}, None => {}
} The whole thing all together looks like this: use leptos::*; fn main() { mount_to_body(|cx| { view! { cx, <RadApp /> } }) } #[component] fn RadApp(cx: Scope) -> Element { let form_handler = |submission_event: web_sys::SubmitEvent|{ submission_event.prevent_default(); match submission_event.target() { None => {}, Some(form_event_target) => { let form_element = form_event_target.unchecked_ref::<web_sys::HtmlFormElement>(); let form_data = web_sys::FormData::new_with_form(&form_element); match form_data{ Err(_) => {}, Ok(data) =>{ match data.get("fav_thing_to_paint").as_string() { Some(fav_thing) => { leptos::log!("{:?}", fav_thing); }, None => {} } } } } } }; view! { cx, <form on:submit=form_handler> <input type="text" name="fav_thing_to_paint" placeholder="Your fav thing to paint..." value="" /> <input type="submit" value="Submit" /> </form> } }

