We will need to find a way to call out to the Web Storage API through web_sys. The first step is finding out where web storage exists in JavaScript in the browser. The MDN Web Storage API documentation state, "These mechanisms are available via the Window.sessionStorage and Window.localStorage properties." Leptos provides us with a window() function which will efficiently return a web_sys::Window, allowing us to communicate to the browser's window. If we look at the web_sys::Window documentation , we'll see that there is a local_storage method! Calling local_storage returns a Result<Option<web_sys::Storage>, web_sys::JsValue>. We'll need to get the Ok(Some(storage)) from it (Ok because of the result which contains Some because of the option). Once we do, we'll get that web_sys::Storage, which we can work with. The web_sys::Storage struct's documentation enumerates all of the methods we can call, including get() and set()! Chaining Unwraps You can use unwarps to extract the Ok and Some like this: let storage = window().local_storage().unwrap().unwrap(); The problem is that upwrap() will throw a panic if it's the Err or None variants of Result and Option respectively. We don't want our application to panic! Nested Matches We can use pattern matching as a potential solution: match window().local_storage() { Ok( maybe_some_storage ) => match maybe_some_storage { Some( storage ) => { // Do your stuff wth storage }, None => {} }, Err() => {}
} This solution doesn't panic, which is great. But it does put our code in deeply nested scopes which makes it hard to read. Assigning the value of a match What we're looking to do is assign the value to storage if it can be retrieved from the nested Result/Option, otherwise we'll do nothing. Do keep in mind that most applications will want to do something in the event that expected behaviour can't be followed. A match statemetn will evaluate to the value of its matched expression. We can assign that value to a variable! Currently that value is wrapped in an Option, which is then wrapped in a Result. We are able to use the same nesting of our return types to create a patterns to extract the value we're looking for. By combining these we can say, "If local_storage() returns an Ok that has Some storage, let the value of the match statement be storage." The other pattern marked with an underscore (_) indicates a catch-all. Anything that doesn't match what we want will return, breaking out of our closure! let storage : web_sys::Storage = match window().local_storage() { Ok(Some(storage)) => storage, _ => return };
// We will only run code here if storage was able to be unwrapped by the match I added the web_sys::Storage type to make this more clear, but Rust will infer the type. You do not need to write it.

