5.1 Understanding main.rs At this point we have a Rust application which compiles to WASM and we have a server running, listening at 127.0.0.1:8080 for requests, responding with our index.html and linked assets, most importantly our Rust application in WASM form. What we don't have here is anything that updates our index.html or any form of interaction between our Rust application (WASM) and the DOM (Document Object Model — a name for the hierarchy of html elements/nodes) in the index.html. We've addd leptos to our application as a dependency, and now we're going to put it to use. If we look in our src/main.rs we can see the following: fn main() { println!("Hello, world!"); } Here we have a function (using the keyword fn) with the name main. The ( and ) are like bookends that encapsulate a functions parameters (buckets to hold arguments passed to them) and arguments (values assigned to the parameters when called) that the function might use to run. In this case, the main function doesn't require anything to run, so it has nothing between its parenthesis after the function name. The following set of curley braces { and } encapsulate the function body here. This is what will be evaluated when the function is run; the work being done. This is the most minimal example of a function signature . There are more things that can be added but we'll get into those later. The body of the function contains a single expression. Expressions need to end with ;. You can think of it as a terminator for the end of an instruction or step that you want the application to perform. Let's look at the content of this line. We have println!("Hello, world!"); We can look at this as some-command(some-arguments)end The command is println!, the argument is a sequence of characters wrapped by quotes as a convenient way to tell the compiler that you mean the characters and not other commands or variables, and an end of expression character ; semicolon. The command println! is provided by Rust's standard library for you to use to output text to the terminal. If you run your application you'll see Hello, world!, and this is why. Important: We've glossed over how to write your own functions with parameters. We've also skipped over how to write functions that return values. Don't worry, we'll cover that when appropriate. Macros We saw before that the main function is written as fn main(){}. There is no ! after main. But there is a ! after println!. The ! indicates that command is a macro. Macros are like code snippits or code templates that get expanded by the Rust compiler before it's final compilation. There are function like macros, which use () to encapsulate their argumens. There are also procedural macros, which use {} to encapsulate a body of code which gets consumed by the macro. As you can imagine, there is a lot involved in actually printing something to the terminal, but we can ignore the complexity with things like println!. Macros have parameters which you can pass arguments to, just like functions. Leptos makes extensive use of macros to make our lives easier. They're wonderful! Important: Macros have the ability to parse (read through to understand/process) their arguments differently from standard Rust code. Keep in mind that the macro author is usually trying to do things that make life easier for the developer using their macro. Sometimes this includes reduction of noisey syntax that would normally be required, or inferences that can be assumed. 5.2 Updating main.rs to use Leptos Now that we understand how Rust functions work we can start to bring Leptos into our main.rs. We do this by telling the compiler that we want to use leptos. We've added leptos as a dependency in our cargo.toml, so it now exisgts is our 'application universe' as a thing. But, it doesn't exist in our main.rs because we haven't brought it into scope yet. Bringing things into scope is like bringing things to a workbench or crafting table to use. You need those things at hand, where you're working, so that when you refer to them the compiler knows what you mean and has the bits of code to actually use. When we write use leptos::*; at the top of our main.rs file, we're telling Rust, use and think called leptos which you should be aware of because we defined it in our cargo.toml, and bring ALL of it's pieces into scope for us to use. The :: is a separator the same a slash is a separator for hierarchy in your computer's file system. The * refers to 'everything'. use leptos::*; reads as use everything from leptos. To visualize this, think of it as taking a box of tools called "Leptos" and dumping all of them out onn your work bench. You can now grab any one of them for use. 5.3 Updating fn main() to interact with your html In our main.rs we have a fn main(){}. Currently it prints "Hello, world!" to our standard out (terminal/console). What we want to do is to change the HTML in index.html when the WASM loads, which is also when the fn main() runs. We'll use a function called mount_to_body, which is provided as a tool in leptos, made available in this scope (this main.rs file) with the use statement. use leptos::*; fn main() { mount_to_body()
} mount_to_body requires some arguments to run correctly. Specifically, it requires a closure. It requires a value that is actually 'runable' or 'callable'. Closures A closure is functionality as a first class citizen . This means that it's a function that can be stored as a value and passed around to be called later. fn print_hi(){ println!("Hi");
} A standard function definition. fn main(){ // let tells the compiler to assign // the value of greeter to whatever is // after the = and before the semicolon. let greeter = || { println!("Hi"); };
} Single line comments in Rust are prefixed by // at the beginning of the commend. These tell the compiler to ignore anything after it. || { println!("Hi");
} A closure The above closure syntax is like a function, but it doesn't have a name because we're expecting to assign the functionality to a name. Like we did with greeter above. The parenthesis that normally encapsulate a functions arguments are converted to pipe characters to diambiguate the two. The body of the closure, just like the body of a function, is encapsulated by curly braces. The following shows how a function and a closure can be called: print_hi(); // This was a function
greeter(); // This was a value `greeter` The coolest thing here is that we can see both print_hi and greeter are names that exist in or applications context. They're ideas. Both of them are callable. And we can call them by adding parenthesis at the end. This starts to hint at some of the underlying simplicity of a lot of programming. At the end of the day, we're giving names to things so that we can specify to the computer, what is what. Then we evaluate or run a bit of functionality, and give the result a name so that we can do something else after. It's this over and over again, all the way down. Using mount_to_body Recall that our application's main.rs looked like this use leptos::*; fn main() { mount_to_body()
} We have mount_to_body function being called when the application runs as WASM, when index.html is server with the WASM resource. This function needs functionality to call. It needs a closure. We have the opportunity to tell it what to do with the assumption that when mount_to_body runs, it'll provide us the context in which it's running. This of this as a scope. We can make this assumption because mount_to_body specifies that it needs a closure that makes use of an argument, which we know to be context, abbreviated here as cx. use leptos::*; fn main() { mount_to_body(|cx|{})
} The above shows what an empty closure being passed to mount_to_body looks like. What this doesn't show is that the closure needs to return something that can be mounted. If you ran the above you're probably receive an error like: T: Mountable, required by this bound in `leptos::mount_to_body` The error messages will get easier to read over time, but it essentially says, "The return type of the closure can't be used by the internals of mount_to_body. It was expecting something specific to come out of your instructions." To solve this problem we're going to use the view! macro provided by leptos. use leptos::*; fn main() { mount_to_body(|cx|{ view! { cx, <h1>"Hello, world!"</h1> } })
} We've written the following in the body of the closure, being provided to mount_to_body as: view! { cx, <h1> "Hello, world!" </h1> } This procedural macros view! has a body which starts with cx, the context that will be provided to it by mount_to_body when it's run (again, this is inside mount_to_body and evaluated at a later time) and the view or html to mount. There must be one top level item and all text needs to be quoted. It's a JSX like syntax and beautifully streamlined to write. If you had trunk serve running this whole time, you can visit http://127.0.0.1:8080 to see your "Hello, world!" Or, make sure your present working directory is the root of your application, type trunk serve and visit http://127.0.0.1:8080 to see your first working leptos WASM client side awesomeness!

