What we need to do is create a wasm_bindgen::closure::Closure and then cast the closure to a js_sys::Function . The MDN documentation uses a struct with a _closure property. We'll do things slightly differently, stepping through each line of code and what it does. The first step is making a closure. We'll use the Closure::wrap method. The documentation defines it as: A more direct version of Closure::new which creates a Closure from a Box<dyn Fn>/Box<dyn FnMut>, which is how it’s kept internally. This sounds like exactly what we want, // cb stands for callback
let cb = wasm_bindgen::closure::Closure::wrap( // We need something here.
); We need to provide an argument which is a Box that contains a dyn FnMut. There's a lot here to unpack. Box In Rust, there are two types of memory allocation, heap and stack. The stack is fast but requires the size of what's being stored in it to be consistent and known. The heap allows us to store things that may change in size, but they need to be looked up in the stack to get their actual values. It's two steps instead of one. Also, the heap isn't as organized as the stack, so it's lookups will also be slower. A Box is a way for us to store data in the heap. The actual size of a Box is known, because it's a pointer to memory in the heap. dyn (dynamic) Rust wants to know everything in advance to be able to optimize all code and make its security guarantees. If we're going to be skipping across contiquous zeros and ones in memory and interpreting them as data, we need to know the size of the data we're reading. Unfortunately sometimes this isn't possible to do at compilation time. When we use traits as types in Rust, we're telling Rust that anything that impements the specified trait is fair game for use as an argument. This is a powerful technique because we're allowing any values to be used in the future provided someone writes an impl (implementation) for the given trait. For example: struct RobotDuck{} impl RobotDuck { fn assert_duckitude() { println!( "I'm totally not a robot. Look at me click on these images of bread floating in a pond." ) }
