We previously listed off our cat names and hard coded them into a template. It would be better to pull that data out into a data structure which we can then do work over (for each item in the stucture) to generate the list items. I say better because we're assuming that these items are going to change. In this lesson we're imagining that the list of great cat names will grow over time. It is completely reasonable to write out a list and be literal if you don't expect things to change. Arrays Rust standard library documentation One of the most basic data structures that exists in Rust is an Array. It is a group of the same type of data, with a set quantity or storage/size. We can assign an array to a variable by wrapping a set of the same types of data in square brackets, separating each item with a comma. let cat_names = ["Beans", "Basil", "Oliver"]; Rust will infer (figure out) that the data type of cat_names is [&str; 3] (the items in the array are &str and there are 3 of the). The type signature for arrays uses square brackets, encapsulating the the type of the items in teh array, followed by a semicolon, and the size of the array or quantity of items in the array. We could have written the following as well: let cat_names: [&str;3] = ["Beans", "Basil", "Oliver"]; Fixed Length An important thing to note is that arrays are of immutable length. You can not add an item to an array because Rust has blocked off a space in memory for the array. There is no extra space to store another item. This is part of how Rust maintains memory safety. It won't allow you to just dump your data into the spot after an array to make a "bigger array". Forced Type The type of items needs to be the same for each item in an array. This is so that Rust knows how much memory to allocate to store the number of items. You can not do the following: let cat_names: [&str;4] = ["Beans", "Basil", "Oliver"]; Rust's compiler will complain about the value you're assigning being [&str;3], because there are three items, but let cat_names: [&str;4] = will try to allocate extra space. At that point Rust won't know what is actually in that fourth space. If it can't guarantee what's there, Rust's compiler won't let the application compile. As disciplined as we all think we are, it's easy to miss checking the data at that location in memory when we use it. You might think there's a &str there but who knows! There are better ways to handle variable length sequential groups of same typed data. But, if you did want to use an Array, you could specify an option type. let cat_names: [Option<&str>;4] = [ Some("Beans"), Some("Basil"), Some("Oliver"), None
]; It's important to note that there are still 4 items, and each item is of the same type. &str We wrote "Beans", "Basil", and "Oliver." All three of these would often be referred to as "string values" in other programming languages. They're a series of "characters." Oh! That sounds familiar. They're a series... they're a collection of the same type. It sounds a lot like an array doesn't it?! That's because they are! But they're not characters in a way that you might think. Let's look at what these individual values actually are to get a complete understanding of what's going on here. We know that at the end of the day, everything in a program has to be turned into a numerical value. If you think back to being a kid (or maybe you still are ^.^) you may have written coded messages, replacing letters with numbers, A becomes 1, B becomes 2, C becomes 3, and so on. Perhaps "Beans" is a series of characters that become a series of numerical values. There are 5 characters, so maybe "Beans" is actually an array of 5 x 8bit integers, with the type signature [u8;5]. Well it turns out that there is an older system called the ASCII character set that works like this. If we were using ASCII we could represent Beans as an array of 7bit integers. The ASCII character set contains 128 characters. 7 binary bits allows us to create values of 0 ( 0000000 ) to 128 (1111111). B, E, A, N, S
66, 69, 65, 78, 83 ASCII is pretty limited though. What if I wanted to put an emoji of beans as the name! 🫘 How do I represent that in ASCII. I can't. This makes me sad. Thankfully, there's a system called Unicode that allows us to extend the available "character set". In Rust, all text is required to be valid Unicode or UTF-8 . Rust uses str as a data structure to hold these UTF-8 "characters." I used quotes there because Unicode is more like a virtual structure of characters floating in space and characters are "code points" in thst cloud of expressive units. You can think of str as string. The str hides the complexity of unicode so that you can just write your program, while still being able to use all 1,112,064 valid character points. In summary str is a fixed length data strcture of code points. It is immutable. When we write &str we're referring to a string slice in Rust, which is a reference to a set of "characters," but again, the characters are code points. ^.^ Vectors Rust standard library documention Vectors are like arrays in that they are a sequential group of the same data type, but differ in that they are of variable length. You can create a new vector with the Vec struct's new static method. let cat_names = Vec::new(); At this point there is no data type asigned to the Vector. We can specify the type in advance. let cat_names: Vec<&str> = Vec::new(); Rust will infer the type if we use the from static method using an array. let cat_names = Vec::from(["Beans", "Basil", "Oliver"]); Or we can let Rust infer the type. It will pick up the type of the first item stored in the vector and use that as the requirement for all future additions. If you want to edit a vector you'll need to make it mutable though. let mut cat_names= Vec::new(); // no internal type
cat_names.push("Beans"); // now the internal type is &str
cat_names.push("Basil"); cat_names.push("Oliver"); Vectors can also be made using the handy vec! macro: let cat_names= vec!["Beans","Basil", "Oliver"];

