Let's update our example application to store our cat names in a Vec using the vec! macro. use leptos::*; fn main() { let cat_names = vec!["Beans","Basil", "Oliver"]; mount_to_body(|cx| view! { cx, <h1>"Great cat names"</h1> <ul> </ul> }) } We need to fill in that gap in the unordered list tags <ul>...</ul> with our list items. Let's imagine that there's a function called list_names which will give us a Vector of Views. To make views, we need a context, and to list names we actually need the names. This tells us our two arguments to the function. We need to wrap this in curly braces so that it gets executed. fn main() { let cat_names= vec![ "Beans", "Basil", "Oliver" ]; mount_to_body(|cx| view! { cx, <h1>"Great cat names"</h1> <ul> {list_names(cx,cat_names)} </ul> })} Now we need to write the function. I like to start with the signature. Let's make sure we know what it's accepting and what we want to get out of it. The body of the function is where we connect the dots. fn list_names(cx: Scope, cat_names: Vec<&str>) -> Vec<View> { // STUFF HERE
} If we want to do something to a Vector in Rust we'll need to turn it into an iterator. We can call the method into_iter() to turn our current evaluated value into that special iterator. cat_names .into_iter() Next we want to do something to each item. We want to change each &str into a view. Map is a method that can be called on an interator that will apply to each item. It accepts a closure which operates on each item. Its a function in a mathematical sense! Our first step is turning each one of these into a view. cat_names .into_iter() .map( move |name| view!{cx, <li>{name}</li>} ) Note that if we have a single line of code, we don't need to add curley braces to define the body of a closure. Move is necesary because &str values don't support copy. If we're using name into the view! macro, it will love out of its iterator. The second step is turning these into an actual View. cat_names .into_iter() .map( move |name| view!{cx, <li>{name}</li>} ) .map( move |li| li.into_view(cx) ) We now have an iterator with Views that we need to convert into a Vector of Views. We can call collect on the iterator to turn it back into a "collection" which is our Vector. fn list_names(cx: Scope, cat_names: Vec<&str>) -> Vec<View> { cat_names .into_iter() .map( move |name| view!{cx, <li>{name}</li>} ) .map( move |li| li.into_view(cx) ) .collect() } We don't have a semicolon at the end of collect(). That makes the result of collect() the final statement/expression and the returned value of the function. At this point we're going to get some issues with lifetimes. Rust will complain because we're passing a Vector of references into a function, and getting back a Vector of Views that used the reference. Rust can't guarantee that the references to those string slices will live as long as the Vector of Views that they generate through this function. We can specify a static lifetime for the string slices which is the same lifetime as the Views, solving our problem. fn list_names(cx: Scope, cat_names: Vec<&'static str>) -> Vec<View> { cat_names .into_iter() .map( move |name| view!{cx, <li>{name.clone()}</li>} ) .map( move|li| li.into_view(cx) ) .collect() } Here's what our final application looks: use leptos::*; fn main() { let cat_names= vec![ "Beans", "Basil", "Oliver" ]; mount_to_body(|cx| view! { cx, <h1>"Great cat names"</h1> <ul> {list_names(cx,cat_names)} </ul> })} fn list_names(cx: Scope, cat_names: Vec<&'static str>) -> Vec<View> { cat_names .into_iter() .map( move |name| view!{cx, <li>{name.clone()}</li>} ) .map( move|li| li.into_view(cx) ) .collect() } What if static lifetimes aren't an option? If you can't use static lifetimes, you can convert the &str (string slices) into owned strings, of type String. I used three different approaches to converting a string slice &str into a String. You can call to_string() on the slice's value, you can call a method on the String struct, or you can call into. Then we need to update the list_names parameter type from Vec<&'static str> to Vec<String> use leptos::*; fn main() { let cat_names = vec![ "Beans".to_string(), String::from("Basil"), "Oliver".into() ]; mount_to_body(|cx| view! { cx, <h1>"Great cat names"</h1> <ul> {list_names(cx,cat_names)} </ul> })} fn list_names(cx: Scope, cat_names: Vec<String>) -> Vec<View> { cat_names .into_iter() .map( move |name| view!{cx, <li>{name.clone()}</li>} ) .map( move|li| li.into_view(cx) ) .collect() } Inline closures In the above example we used a function to generate the Vector of Views. Keep in mind that this is happening in a closure that is being passed to the mount_to_body function. The scope variable cx does not exist outside of this! As a result, we can not create closures outside of the mount_to_body closure. If we crested an app component we would be in a state where the scope exists. It would open up more clean syntax. use leptos::*; fn main() { let cat_names = vec![ "Beans", "Basil", "Oliver" ]; mount_to_body(|cx| view! { cx, <ListNames cat_names/> })} #[component] fn ListNames(cx: Scope, cat_names: Vec<&'static str>) -> impl IntoView { let list_items: Vec<_> = cat_names .into_iter() .map( move |name| view!{cx, <li>{name}</li>} ) .collect(); view! {cx, <h1>"Great cat names"</h1> <ul> {list_items} </ul> }
} Note, you can not inline the cat_names.into_iter().etc in place of {list_items} in the view macro because of how macros are processed. The variables need to be evaluated in advace in this case. A subtle but important difference in the above example is that we have a Vector of Leptos::HtmlElements. We don't have to concretely specify their type, which allows us to set the type of list_items to Vec<_> meaning Vector of...it doesn't matter because we never need to check the concrete type. When we pass the Vec<HtmlElement<?> into the view! macro via {list_items}, the macro checks against HtmlElements being valid values. We can skip declaration of th e concrete types in this situation. By contrast we needed a concrete type for a function definitions return type, which is why we used Vec<View> earlier. It wouldn't be possible for us to say <Vec<HtmlElement<?>>. Tradeoffs with using iterators without keys This is a fine approach for simple applications, but it starts to break down when you're using signals and concerned about performance. If cat_names was a signal (a read signal which updates views when it is updated), we'd end up re-rendering the whole list of names. This isn't ideal.

