The view! macro has a helper called <For /> that will do a lot of this leg work for us. The benfits of using <For > is that Leptos will associate a key with each item output. The key allows Leptos to target granular updates to avoid rerendering the whole list. There are three properties that we must assign for the <For /> tag. each: A closure that returns the collection. The collection must support the ability to be converted into an interable. Vectors and Arrays work perfectly fine here. key: A closure that will return a value that can be used as an identifier for a given item view: A closure that will return the view for a given item. Ownership can be tricky with <For />. We'll need to clone the names for the iteration so that we can guarantee that the references don't go away. We need to do something similar for the key closure. We need to clone the returned value. If we didn't, the value would get dropped. use leptos::*; fn main() { let cat_names = vec![ "Beans", "Basil", "Oliver" ]; mount_to_body(|cx| view! { cx, <ListNames cat_names/> })
} #[component] fn ListNames(cx: Scope, cat_names: Vec<&'static str>) -> impl IntoView { view! {cx, <h1>"Great cat names"</h1> <For each={ move || cat_names.clone()} key={ |name| name.clone()} view={ move |name| { view! { cx, <li>{name}</li> } } } /> }
} With more complex data stuctures use leptos::*; #[derive(Clone)] struct CatName { name: String, rating: u8, } fn main() { let cat_names = vec![ CatName { name: "Beans".to_string(), rating: 1 }, CatName { name: "Basil".to_string(), rating: 2 }, CatName { name: "Oliver".to_string(), rating: 3 }, ]; mount_to_body(|cx| view! { cx, <ListNames cat_names/> })
} #[component] fn ListNames(cx: Scope, cat_names: Vec<CatName>) -> impl IntoView { view! {cx, <h1>"Great cat names"</h1> <For each={ move || cat_names.clone()} key={ |cat_name| cat_name.rating} view={ move |cat_name| { view! { cx, <li id={cat_name.rating}> {cat_name.name} </li> } } } /> } }

