Let's see if we can use this in our view! macro to conditionally display some text. We want our message to print out if a condition is true. You can imagine that your applications conditions are more dynamic and interesting. We're hard coding the condition here so that the example is consistent and easy to follow. We want to do something like this, but we only want the message "Hooray. They love cats!" to print if they actually do. use leptos::*; fn main() { mount_to_body(|cx| { view! { cx, "Hooray. They love cats!" } })
} We'll refactor this a bit, moving the string out of there into a variable. use leptos::*; fn main() { mount_to_body(|cx| { let message = "Hooray. They love cats!"; view! { cx, {message} } })
} But we want that to be changed on a condition. We want the message to be empty, but if they love cats, then it should contain our "Hooray. They love cats!" text. use leptos::*; fn main() { mount_to_body(|cx| { let loves_cats = true; let message = ""; if loves_cats { let message = "Hooray. They love cats!"; } view! { cx, {message} } })
} This looks like it should work, but it doesn't. Rust's compiler is smart. It's very smart. It wants to make sure that we don't leave memory allocated that isn't being used. To make sure that unused variables are freed up safely it follows a rule. Any variables used in a scope (encapsulated with curly braces {...}) will have their memory freed (Rust's compiler calls this Dropping) at the end of the scope. Variables used in the scope are those moved into it or allocated/defined in it. The only values left are those written as the last statement in the scope, which is the evaluated value of the whole scope/code block. Here's what's happening in secret. let message = ""; if loves_cats { // Let's assign message to a value let message = "Hooray. They love cats!"; // We're at the end of the scope. // Let's clean up `message`.
} We can solve this problem by making message mutable, adding the mut keyword after let. We can then reassign message through the mutable reference that gets moved into the if statement's scope. Not that it's important that message be assigned an empty string value so that it is initialized. // make message mutable
let mut message = ""; if loves_cats { // A mutable reference is used behind the scenes // and `moved` into this scope. message = "Hooray. They love cats!"; // We're at the end of the scope. // The mutable reference is cleaned up // The owned value of message was never // actually moved, and still exists outside // of the `if`
} We now have a conditional that works, displaying a message if the predicate is true in our UI. use leptos::*; fn main() { mount_to_body(|cx| { let loves_cats = true; let mut message = ""; if loves_cats { message = "Hooray. They love cats!"; } view! { cx, {message} } })
}

