What if we wanted to bring this inline, in our view! macro? Here's where things get interesting. There is an interesting little trick here with Rust's if statements. If we recall, Rust is an expression language and expressions evaluate to the last statement. You can think of it as the "final word." In the example below, the block of code for the if statement evaluates to a unit type . It's almost like Rust's take on null, written as (). let loves_cats = true; if loves_cats { let message = "Hooray. They love cats!"; // ^ // semicolon means this isn't // the last thing left. It has ended // The final word here has nothing, // which represents as the () or unit type
} So really, the whole if statement ends up evaluating to a unit type. if loves_cats { let message = "Hooray. They love cats!"; // Invisible unit type gets added here // ()
} If we drop the semicolon, it will evaluate to a &str, the last expression in the scope! if loves_cats { "Hooray. They love cats!" } Let's replace our message variable with the inline if conditional statement use leptos::*; fn main() { mount_to_body(|cx| { view! { cx, { if loves_cats { "Hooray. They love cats!" } } } })
} Now this looks like it should work! But it doesn't, and there's good reason for it. The if statement evaluates to a &str (string slice) value if it is true. But what about if it's false? In this case, it would be a unit type and that isn't valid input for the view! macro. We can add a else block with an empty string slice to solve this problem. use leptos::*; fn main() { mount_to_body(|cx| { view! { cx, { if loves_cats { "Hooray. They love cats!" } else { "" } } } })
} You can also replace this with a match statement for a bit more clarity. use leptos::*; fn main() { mount_to_body(|cx| { let loves_cats = true; view! { cx, { match loves_cats { true => "Hooray. They love cats!", false => "" } } } })
}

