Leptos provides a conditional tag to make this a bit more straight forward. The show tag also offers some optimizations. It will not processes branches that are already active if no changes have been made. Raw if statements will evaluate their predicate and evaluate their success scopes each time. More details can be found in the official documentation . The <Show> tag requires two properties, both of which are closures. when: A closure for the predicate. It will be run to see if it is true or not. If true, the children of the <Show> tag will be printed. fallback: A closure that returns what to display if the predicate is false. This is like the else branch. use leptos::*; fn main() { mount_to_body(|cx| { let loves_cats = true; view! { cx, <Show when=move || loves_cats fallback=|_| "Give it time" > "Hooray. They love cats!" </Show> } })
} It's important to note that this can also be written with curly braces in the closures to make them more clear. Here's an example for the sake of familiarity. <Show when=move || { loves_cats } fallback=|_| { "Give it time" }
> "Hooray. They love cats!" </Show> The fallback will send a context along with it, allowing you to return views. use leptos::*; fn main() { mount_to_body(|cx| { let loves_cats = true; view! { cx, <Show when=move || loves_cats fallback=|cx| view!{cx,"Give it time"} > "Hooray. They love cats!" </Show> } })
}

